The following code illustrates how to load webpage using web view. usingUnityEngine;
usingSystem.Collections;
usingVoxelBusters.EssentialKit;

publicclassExampleClass:MonoBehaviour
{
publicWebViewm_webView;

privatevoidStart()
{
//setwebviewproperties
m_webView=WebView.CreateInstance();
m_webView.SetFullScreen();

//startrequest
m_webView.LoadURL(newURLString("https://www.google.com"));
}

privatevoidOnEnable()
{
//registeringforevent
WebView.OnShow+=OnShow;
WebView.OnHide+=OnHide;
WebView.OnLoadStart+=OnLoadStart;
WebView.OnLoadFinish+=OnLoadFinish;
}

privatevoidOnDisable()
{
//unregisteringevent
WebView.OnShow-=OnShow;
WebView.OnHide-=OnHide;
WebView.OnLoadStart-=OnLoadStart;
WebView.OnLoadFinish-=OnLoadFinish;
}

privatevoidOnShow(WebViewresult)
{
if(m_webView==result)
{
Debug.Log("Showingwebview.");
}
}

privatevoidOnHide(WebViewresult)
{
if(m_webView==result)
{
Debug.Log("Hidingwebview.");
}
}

privatevoidOnLoadStart(WebViewresult)
{
if(m_webView==result)
{
Debug.Log("Startedloadingrequestwithurl:"+m_webView.URL);
}
}

privatevoidOnLoadFinish(WebViewresult,Errorerror)
{
if(m_webView==result)
{
if(error==null)
{
Debug.Log("Webviewdidfinishloadingrequestsuccessfully.");
}<br>
else
{
Debug.Log("Webviewdidfailtoloadrequest.Error:"+error.Description);
}
}
}
}
